// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/utils/math/SafeMath.sol";
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/access/Ownable.sol";
contract CalculateUtils is Ownable{
    uint256 private rate;
    uint256 private vfN;
    //获得罚金比率
    function punishRatio(uint256 _bounts) internal view returns(uint256) {
        uint256 ratio;
        if (_bounts <rate) {
            ratio = 1;
        }else if(_bounts>=rate&&_bounts<rate*1e1) {
            ratio = 1e1;
        }else if(_bounts >=rate*1e1 && _bounts <rate*1e2){
            ratio = 1e2;
        }else if(_bounts >=rate*1e2 && _bounts < rate*1e3) {
            ratio = 1e3;
        }else if(_bounts>=rate*1e3 && _bounts <=rate*1e4) {
            ratio = 1e4;
        }else if(_bounts>=rate*1e4 && _bounts <=rate*1e5) {
            ratio = 1e5;
        }else{
            //revert ParameterException("Unable to calculate,Please submit a request");
        }
        return ratio;
    }
    //修改汇率
    function setRate(uint256 _rate) internal onlyOwner{
        rate = _rate;
    }
    //校对工作量（人） 校对人数= 翻译人数/校对工作量
    function setvfN(uint256 _vfN) internal onlyOwner {
        vfN =_vfN;
    }
    function getMatNumber(uint256 _transNumber)external view returns(uint256 ){
        uint256 _maxV;
        if(_transNumber<=vfN){
                 _maxV = 1;
        }else{
                  _maxV = SafeMath.div(_transNumber, vfN);
        }
        return _maxV;
    }
    //计算任务赏金
    /**计算任务所需翻译人数：
    1.求出阈值day
    2.判断文件类型：1.文档类  
    */
}

LibProject.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
library LibProject {
//项目状态：已发布、进行中、超时、无人选择、已关闭,已完成
 enum ProjectState { Published,Processing,Overtime, NoOnePick, Closed,Completed }
 // 校验者||翻译者状态 
 enum TaskerState { Waiting, Processing, Submitted,Pass,Fail, Return, Completed, TimeOut }
 //文件状态
 enum FileState { Waiting, Translating, Validating, WaitModify, BuyerReview, Accepted }
 //文件
 struct FileInfo {
     string  name;
     uint256 size;
     uint256 videoLength;
     uint256 Page;
     uint256 words;
     uint256 fileType;
     string  path;
 }
 //子任务详情
 struct TaskInfo {
     FileInfo file; 
     uint256 bounty; 
     FileState state;
     uint256 lastUpload;
 }
 struct Tasker {
     address taskerAddress;
     uint256[] taskIndex;
 }
 //项目
 struct TranslationPro {
        uint256 releaseTime;  //发布时间
        string introduce;     //项目介绍
        string need;          //项目需求说明
        uint256 deadline;     //截至日期
        string sourceLanguage;//源语言
        string goalLanguage;  //目标语言
        string[] preferList;  //偏好
        uint256 translationType;//类型
        uint256 workLoad;
        bool isNonDisclosure; //是否保密
        bool isCustomize;     //是否为自定义支付
        uint256 bounty;        //赏金
        TaskInfo[] tasks;     //子任务
        Tasker[] translators; //翻译者
        Tasker[] verifiers;   //校验者
        uint256 maxT;        //翻译者最大人数
        uint256 maxV;        //校验者最大人数
        bool isTransActive;  //翻译者状态: true.开启 false：关闭 
        bool isVerActive;    //校验者状态: true:开启 false:关闭
        ProjectState state;        //项目状态
 }
}

